import React from "react";
import {Grid, Paper} from '@material-ui/core'; // Grid version 2


const Login = () => {
    // add styles
    const paperStyle = {
        padding: 2
    }
    return (
        <Grid>
            <Paper elevation={4} style="paperStyle">
                Sign In
            </Paper>
        </Grid>
    )
}

export default Login;
